import "./MyPosts.css";

function MyPosts() {
  return (
    <div>
      <textarea></textarea>
      <button>Add post</button>
      <button>Remove</button>
      <div>My Posts</div>
      <div>New Posts</div>
      <div className="posts">
        <div className="item1">post 1</div>
        <div className="item2">post 2</div>
        <div className="item3">post 3</div>
        <div className="item4">post 4</div>
      </div>
    </div>
  );
}

export default MyPosts;
